import React from 'react';
import { BrowserRouter as Router, Route, Link, } from "react-router-dom";

function HomePage() {

    return (
        <Router>
            <center>
                <div className="hp"><p>Home page</p></div>
            </center>
        </Router>
    );
}
export default HomePage;
